//   }
  
// }


function Navbar() {
  return (
    <>
      
      <div className="navbar-title   topnav" id="myTopnav" >
        
        <table className="navbar-table">
          <tr className="navbar-name">
            <th>
              <Link to="/">
                <p className="navbar-menu">Home</p>
              </Link>
            </th>
            <th >
              <Link to="/about">
                <p >About</p>
              </Link>
            </th>
            <th >
              <Link to="/work">
                <p className="navbar-menu">Work</p>
              </Link>
            </th>
            <th >
              <Link  to="/contact">
                <p  className="navbar-menu">Contact</p>
              </Link>
            </th>
          </tr>
        </table>
        
      </div>
      <div className="hamburger" onclick="this.classList.toggle('open')">
        <MenuIcon/>
      <span>hello</span>
      <span>hello</span>
      <span>psuuu</span>
      <span></span>
    </div>

    </>
  );
}

export default Navbar;
